import React from "react"
import {
    Typography,
    Button,
    Container,
    Grid
} from "@material-ui/core"
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(theme => ({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },
  }));

export const Header = () => {
    return (
        <div className = "component_header">
            <Grid container>
                <Grid item xs = {5} className = "header_title">
                    <Typography>
                        Filebox
                    </Typography>
                </Grid>
                <Grid item xs = {5} className = "header_logout">
                    <Button>
                        Signout
                    </Button>
                </Grid>
            </Grid>
        </div>
    )
}
